import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return props.map((ExpItem) => {
    <div>
      <ExpenseItem
        title={ExpItem.items.title}
        amount={ExpItem.items.amount}
        date={ExpItem.items.date}
      />
    </div>;
  });
}

export default Expenses;
